const { jsPDF } = require("jspdf"); // will automatically load the node version

// this font, is a 64 bit encoded tag font
const font_base64 = '';

// this cross, is a 64 bit encoded picture of a X symbol for the tag. 
const cross_base64 = "data:image/png;base64,";

class OfferTagFactory {

	constructor(pic_of_cross_as_base64_string=cross_base64, font_as_string=font_base64) {
		this.pdf_canvass = new jsPDF();
		this.cross_picture = pic_of_cross_as_base64_string;
		this.add_custom_font(font_as_string);
	}
	
	// this function adds custom font to the document
	add_custom_font (font_as_base64_encoded_string) {
		this.pdf_canvass.addFileToVFS('Bernard_MT_Condensed-normal.ttf', font_as_base64_encoded_string);
		this.pdf_canvass.addFont('Bernard_MT_Condensed-normal.ttf', 'Bernard_MT_Condensed', 'normal');
	}

	// a rudamentry tag template
	offer_tag_template (x_offset=0, y_offset=0, description, normal_price, offer_price, packing, expiry) {

        let pic_width = 23;
        let pic_height = 23;
        this.pdf_canvass.addImage(this.cross_picture, "jpeg", 43+x_offset, 37+y_offset, pic_width, pic_height, "CROSS", "FAST");

        // draw the rectangle and border for the tag
        this.pdf_canvass.setLineWidth(0.7);
        this.pdf_canvass.rect(5.08+x_offset, 5.08+y_offset, 96.82, 83.82);

		// desctiption
		this.pdf_canvass.setFont('Bernard_MT_Condensed');
		this.pdf_canvass.setFontSize(23);
		let slicing_width = 80;
		let description_splited_arr = this.pdf_canvass.splitTextToSize(description, slicing_width);
		for (let i = 0; i < description_splited_arr.length; i++) {
			let line_padding = 8 * i; // calculates the spacing between the description, if multilines are needed
			this.pdf_canvass.text(description_splited_arr[i], 54.61+x_offset, 18+line_padding+y_offset, null, null, "center");
		}

		// currency symbol
		this.pdf_canvass.setFontSize(12);
		this.pdf_canvass.text("MVR", 30+x_offset, 43+y_offset);
		this.pdf_canvass.text("MVR", 30+x_offset, 61+y_offset);

		// prices
		this.pdf_canvass.setFontSize(34);
		this.pdf_canvass.text(normal_price, 54.61+x_offset, 53+y_offset, "center");
		this.pdf_canvass.text(offer_price, 54.61+x_offset, 70+y_offset, "center");
		
		// packing and the expiry
		this.pdf_canvass.setFontSize(13);
		this.pdf_canvass.text(packing, 7.62+x_offset, 81+y_offset);

        let expiry_slicing_width = 27;
        let expiry_splited_arr = this.pdf_canvass.splitTextToSize(expiry, expiry_slicing_width);
        for (let i = 0; i < expiry_splited_arr.length; i++) {
            let expiry_line_padding = 5 * i;
            if (i == 0) {
                this.pdf_canvass.text(`EXP:${expiry_splited_arr[i]}`, 66+x_offset, 81+y_offset+expiry_line_padding);
            } else {
                this.pdf_canvass.text(`${expiry_splited_arr[i]}`, 66+x_offset, 81+y_offset+expiry_line_padding);
            }
        }
        // this.pdf_canvass.text(`EXP:${expiry_splited_arr[0]}`, 66+x_offset, 81+y_offset);
        // this.pdf_canvass.text(`${expiry_splited_arr[1]}`, 66+x_offset, 81+y_offset+5);
	}

	// add new page to the canvass
	add_page() {
		this.pdf_canvass.addPage("a4", "portrait");
	}

	// save the pdf as is
	save_pdf () {
        this.pdf_canvass.save("offer_tag_document.pdf"); // will save the file in the current working directory
	}

	draw(item_data_list) {
		const X_OFFSET_ = 98;
		const Y_OFFSET_ = 85;
		const COUNT_FOR_NEXT_PAGE = 6;

		let x_current_offset = 0;
		let y_current_offset = 0;
		let count_tags_on_cur_page = 0;


		for (let i = 0; i < item_data_list.length; i++) {
			this.offer_tag_template(
				x_current_offset, 
				y_current_offset, 
				item_data_list[i].name, 
				item_data_list[i].retailPrice,
				item_data_list[i].offerPrice,
				item_data_list[i].packing,
				item_data_list[i].expiryDate, 
				);

			count_tags_on_cur_page++;

			// when a tag is drawn on the pdf, offset the x axis so that the template does not overlap
			y_current_offset = y_current_offset +  Y_OFFSET_;

			// if there are three tags on the pdf canvass, change xoffset and reset yoffset
			// drawing begins on the left side, so this is a right side movement horizontally, and an up movement vertically
			if (count_tags_on_cur_page == 3) {
				y_current_offset = 0;
				x_current_offset = x_current_offset + X_OFFSET_;
			}

			// if the page is full (6 tags have been drawn), add new page, and reset both the x and y offsets
			// and current page tag count
			if (count_tags_on_cur_page == COUNT_FOR_NEXT_PAGE) {
				this.add_page();
				y_current_offset = 0;
				x_current_offset = 0;
				count_tags_on_cur_page = 0;
			}

		}

		// when everything is drawn on the canvass, commit it as a pdf
		this.save_pdf();

	}

}

export function tag_maker_vue(list) {
    let tag_maker = new OfferTagFactory();
    tag_maker.draw(list);
}
